import axios from "axios"
import {useState} from "react"
let App=()=>{
  let [sid,setSid]= useState(" ")
  let [data,setData] = useState(" ")
  let fun =()=>{
    axios.get(`http://localhost:5000/getbyid/${sid}`).then((res)=>{
      setData(res.data)
    }).catch((err)=>{
      console.log(err)
    })
  }
  return(
    <div>
      <input type="text" value={sid} onChange={(e)=>setSid(e.target.value)} placeholder="enter sid"/>
      <button onClick={fun}>GetResult</button>
      {data!=null && <div>Chech</div>}
    </div>
  )
}
export default App
